import React from "react";
import tw from "tailwind-styled-components";

const Nav = tw.div`
w-full
h-20
shadow-md
fixed
top-0
left-0
bg-black
text-blue-200
hover:bg-purple-900`;

const Navbar = () => {
  return <Nav></Nav>;
};

export default Navbar;
